import React from 'react';
import BackgroundVideo from '../../Assets/video/backgroundVideo.m4v'
import './main.scss'

export default()=>{

    return(
        <div>
            <video autoPlay loop muted className="video">
                <source src={BackgroundVideo} type="video/m4v"/>
            </video>
        </div>
    )
}
